import { Routes, Route, Navigate } from 'react-router-dom';
import Home from './../pages/Home';
import Tours from '../pages/Tours';
import TourDetails from './../pages/TourDetails';
import Login from './../pages/Login';
import Register from './../pages/Register';
import SearchResultList from './../pages/SearchResultList';
import ThankYou from '../pages/ThankYou';
import AddTours from '../admin/AddTours';
import AllTours from '../admin/AllTours';
import Dashboard from '../admin/Dashboard';
import ProtectedRoute from './ProtectedRoute';
import Users from '../admin/Users';
import Bookings from '../admin/Bookings';
import Statistics from '../admin/Statistics';
import About from '../pages/About';

const Routers = () => {
  return (
    <Routes>
      <Route path="/" element={<Navigate to="/home" />} />
      <Route path="/home" element={<Home />} />

      <Route path="/tours" element={<Tours />} />
      <Route path="/about" element={<About />} />
      <Route path="/tour/:_id" element={<TourDetails />} />

      {/* Use ProtectedRoute as a child of Routes */}
      <ProtectedRoute path="dashboard" adminOnly={true}>
        <Route path="/" element={<Dashboard />} />
        <Route path="statistics" element={<Statistics />} />
        <Route path="all-tours" element={<AllTours />} />
        <Route path="add-tours" element={<AddTours />} />
        <Route path="bookings" element={<Bookings />} />
        <Route path="users" element={<Users />} />
      </ProtectedRoute>

      <Route path="/login" element={<Login />} />
      <Route path="/register" element={<Register />} />
      <Route path="/thank-you" element={<ThankYou />} />

      <Route path="/tours/search" element={<SearchResultList />} />
    </Routes>
  );
};

export default Routers;
